statustext[174251]="ELEVATOR INSTALLATION  Through December* 2018  <img src='images/routes/14px/D.gif' align='bottom' /> <img src='images/routes/14px/N.gif' align='bottom' /> 62 St/New Utrecht Av Station transfer passageway closed<br>$$<br>For free out-of-system transfer with <a  href=http://web.mta.info/metrocard/ target=_blank>MetroCard</a>  , exit to street and use entrances on 14 Av at 60 St for the <img src='images/routes/14px/D.gif' align='bottom' /> or 15 Av at 63 St for the <img src='images/routes/14px/N.gif' align='bottom' />.<br><br>*revised<br><br>";
statustext[175021]="SIGNAL MAINTENANCE  Every Mon, Tue and Thu, 12:40 AM to 5 AM (except Nov 20 & 26)  <img src='images/routes/14px/7.gif' align='bottom' /> Vernon Blvd-Jackson Av and Hunters Point Av - Trains board at the Manhattan-bound platform<br>$$<br>&bull; All trains board at the Manhattan-bound platform.<br><br>";
statustext[175023]="SIGNAL MAINTENANCE  Every Wed, Fri and Sat, 12:40 AM to 5 AM (except Nov 24)  <img src='images/routes/14px/7.gif' align='bottom' /> Hunters Point Av and Vernon Blvd-Jackson Av - Trains board at the Flushing-bound platform<br>$$<br>&bull; All trains board at the Flushing-bound platform.<br><br>";
statustext[191444]="STATION ENHANCEMENTS  Through February 2019  Broadway and 39 Av <img src='images/routes/14px/N.gif' align='bottom' /> <img src='images/routes/14px/W.gif' align='bottom' /> Stations are temporarily closed<br>$$<br><img src='images/routes/14px/N.gif' align='bottom' /> <img src='images/routes/14px/W.gif' align='bottom' /> trains skip Broadway and 39 Av in both directions.<br><br>Travel Alternatives<br>  Broadway      Use the nearby <a  href=http://web.mta.info/weekender/tileMap.html?staID=10378 target=_blank>30 Av</a>   or <a  href=http://web.mta.info/weekender/tileMap.html?staID=10376 target=_blank>36 Av</a>   <img src='images/routes/14px/N.gif' align='bottom' /> <img src='images/routes/14px/W.gif' align='bottom' /> or <a  href=http://web.mta.info/weekender/tileMap.html?staID=10249 target=_blank>Steinway St</a>   <img src='images/routes/14px/M.gif' align='bottom' /> <img src='images/routes/14px/R.gif' align='bottom' /> Stations.<br><br>  &bull; Take the Q102 bus (days/evenings) along 31 St and transfer, with <a  href=http://web.mta.info/metrocard/mcgtreng.htm#unlimited target=blank>MetroCard</a>  , to the <img src='images/routes/14px/N.gif' align='bottom' /> <img src='images/routes/14px/W.gif' align='bottom' /> at <br>    30 Av or 36 Av.<br>  &bull; Take the Q104 bus (days/evenings) along Broadway and transfer, with MetroCard, to the <img src='images/routes/14px/M.gif' align='bottom' /> <img src='images/routes/14px/R.gif' align='bottom' /><br>    at Steinway St.<br><br>  39 Av      Use the nearby <a  href=http://web.mta.info/weekender/tileMap.html?staID=10376 target=_blank>36 Av</a>   or <a  href=http://web.mta.info/weekender/tileMap.html?staID=10109 target=_blank>Queensboro Plaza</a>   <img src='images/routes/14px/N.gif' align='bottom' /> <img src='images/routes/14px/W.gif' align='bottom' /> or  36 St <img src='images/routes/14px/M.gif' align='bottom' /> <img src='images/routes/14px/R.gif' align='bottom' /> or <a  href=http://web.mta.info/weekender/tileMap.html?staID=10251 target=_blank><br>Queens Plaza</a>   <img src='images/routes/14px/E.gif' align='bottom' /> <img src='images/routes/14px/M.gif' align='bottom' /> <img src='images/routes/14px/R.gif' align='bottom' /> Stations.<br><br>  &bull; Take the Q102 bus (days/evenings) along 31 St and transfer, with MetroCard, to the <img src='images/routes/14px/N.gif' align='bottom' /> <img src='images/routes/14px/W.gif' align='bottom' /> at<br>    36 Av or Queensboro Plaza or the <img src='images/routes/14px/E.gif' align='bottom' /> <img src='images/routes/14px/M.gif' align='bottom' /> <img src='images/routes/14px/R.gif' align='bottom' /> at Queens Plaza.<br><br>Reminder:<br><img src='images/routes/14px/W.gif' align='bottom' /> trains do not operate late nights and weekends.<br><br>";
