statustext[194823]="STATION IMPROVEMENTS  Through Winter 2018-19  Manhattan-bound <img src='images/routes/14px/1.gif' align='bottom' /> platform at 238 St in the Bronx is temporarily closed<br>$$<br>South Ferry-bound trains skip 238 St.<br><br>During this temporary closure, customers will have access to the 242 St-bound platform with MetroCard.<br><br>Travel Alternatives<br>Use nearby <img src='images/routes/14px/1.gif' align='bottom' /> stations at <a  href=https://goo.gl/maps/D3NdsDon8jx target=_blank>231 St</a>   or <a  href=https://goo.gl/maps/ycn519RK1ZM2 target=_blank>242 St</a>  .<br><br>Consider the Bx9 bus to either station or take the Van Cortlandt Park-bound <img src='images/routes/14px/1.gif' align='bottom' /> to 242 St, and transfer to a South Ferry-bound <img src='images/routes/14px/1.gif' align='bottom' />.<br><br>";
statustext[195771]="STATION ENHANCEMENTS  Through December 2018  174-175 Sts <img src='images/routes/14px/B.gif' align='bottom' /> <img src='images/routes/14px/D.gif' align='bottom' /> Station is temporarily closed<br>$$<br><img src='images/routes/14px/B.gif' align='bottom' /> <img src='images/routes/14px/D.gif' align='bottom' /> trains skip 174-175 Sts in both directions.<br><br>Travel Alternatives<br>Please use nearby <img src='images/routes/14px/B.gif' align='bottom' /> <img src='images/routes/14px/D.gif' align='bottom' /> stations at <a  href=http://web.mta.info/weekender/tileMap.html?staID=10209 target=_blank>170 St</a>   or <a  href=http://web.mta.info/weekender/tileMap.html?staID=10207 target=_blank>Tremont Av</a>  .<br><br>Consider the Bx1 or Bx2 (days/evenings) along Grand Concourse and transfer to/from the subway with MetroCard.<br><br>If you need an additional bus transfer, ask the driver for a MetroCard Bus Transfer which can be used for your next local bus ride within two hours. ~ On your return trip, see the station agent at the above locations for a transfer to the bus.<br><br>Reminders: <br><img src='images/routes/14px/B.gif' align='bottom' /> trains run in the Bronx during rush hours only.<br><img src='images/routes/14px/D.gif' align='bottom' /> trains run express in the Bronx (peak direction) during rush hours, local all other times. <br><br>";
statustext[196784]="STATION ENHANCEMENTS  Through January 2019  167 St <img src='images/routes/14px/B.gif' align='bottom' /> <img src='images/routes/14px/D.gif' align='bottom' /> Station is temporarily closed<br>$$<br><img src='images/routes/14px/B.gif' align='bottom' /> <img src='images/routes/14px/D.gif' align='bottom' /> trains skip 167 St in both directions.<br><br>Travel Alternatives<br>Please use nearby stations at <a  href=http://web.mta.info/weekender/tileMap.html?staID=10209 target=_blank>170 St</a>   <img src='images/routes/14px/B.gif' align='bottom' /> <img src='images/routes/14px/D.gif' align='bottom' />, <a  href=http://web.mta.info/weekender/tileMap.html?staID=10047 target=_blank>167 St</a>   <img src='images/routes/14px/4.gif' align='bottom' /> or <a  href=http://web.mta.info/weekender/tileMap.html?staID=10048 target=_blank>161 St-Yankee Stadium</a>   <img src='images/routes/14px/B.gif' align='bottom' /> <img src='images/routes/14px/D.gif' align='bottom' /> <img src='images/routes/14px/4.gif' align='bottom' />.<br><br>Consider the Bx1 or Bx2 (days/evenings) along Grand Concourse and transfer to the subway, with MetroCard, at 170 St <img src='images/routes/14px/B.gif' align='bottom' /> <img src='images/routes/14px/D.gif' align='bottom' /> or 161 St-Yankee Stadium <img src='images/routes/14px/B.gif' align='bottom' /> <img src='images/routes/14px/D.gif' align='bottom' /> <img src='images/routes/14px/4.gif' align='bottom' />. Additionally Bx35 service is available along E 167 St transfer, with MetroCard, to the <img src='images/routes/14px/4.gif' align='bottom' /> at 167 St.<br><br>If you need an additional bus transfer, ask the driver for a MetroCard Bus Transfer which can be used for your next local bus ride within two hours. ~ On your return trip, see the station agent at the above locations for a transfer to the bus.<br><br>Reminders: <br><img src='images/routes/14px/B.gif' align='bottom' /> trains run in the Bronx, during rush hours only.<br><img src='images/routes/14px/D.gif' align='bottom' /> trains run express in the Bronx (peak direction) during rush hours, local all other times. <br><br>";
statustext[200295]="TRACK MAINTENANCE  10:45 PM Fri to 5 AM Mon, Weekends until Nov 19    <img src='images/routes/14px/L.gif' align='bottom' /> Service between between Broadway Junction in Brooklyn and 8 Av in Manhattan is replaced by the M14 and free shuttle buses <br>$$<br><img src='images/routes/14px/L.gif' align='bottom' /> trains run between Rockaway Pkwy and Broadway Junction.<br><br>Special <img src='images/routes/14px/M.gif' align='bottom' /> service runs all weekend between Metropolitan Av and 47-50 Sts, and via the <img src='images/routes/14px/Q.gif' align='bottom' /> between Lexington Av/63 St and 96 St.<br><br><img src='images/routes/14px/shuttle_bus.png' align='bottom' /> Buses will run on three routes making <img src='images/routes/14px/L.gif' align='bottom' /> station stops in Brooklyn:<br>  1. Between Broadway Junction and Myrtle-Wyckoff Avs <img src='images/routes/14px/M.gif' align='bottom' />.<br>  2. Between Myrtle-Wyckoff Avs <img src='images/routes/14px/M.gif' align='bottom' /> and Lorimer St (Metropolitan Av <img src='images/routes/14px/G.gif' align='bottom' />).<br>  3. Loop bus serving Marcy Av <img src='images/routes/14px/J.gif' align='bottom' /> <img src='images/routes/14px/M.gif' align='bottom' />, Hewes St <img src='images/routes/14px/J.gif' align='bottom' /> <img src='images/routes/14px/M.gif' align='bottom' />, Broadway <img src='images/routes/14px/G.gif' align='bottom' />, Lorimer St and Bedford Av<br><br>Travel Alternatives:<br>For service between Manhattan and Brooklyn, take the <img src='images/routes/14px/A.gif' align='bottom' /> <img src='images/routes/14px/J.gif' align='bottom' /> <img src='images/routes/14px/M.gif' align='bottom' /> or, take the <img src='images/routes/14px/G.gif' align='bottom' /> and transfer to/from the <img src='images/routes/14px/E.gif' align='bottom' /> at Court Sq.<br><br>In Brooklyn, transfer between trains and <img src='images/routes/14px/shuttle_bus.png' align='bottom' /> buses at the following stations:<br>&bull; Myrtle-Wyckoff Avs <img src='images/routes/14px/M.gif' align='bottom' /><br>&bull; Marcy Av <img src='images/routes/14px/J.gif' align='bottom' /> <img src='images/routes/14px/M.gif' align='bottom' /><br>&bull; Lorimer St (Metropolitan Av <img src='images/routes/14px/G.gif' align='bottom' />)<br>&bull; Broadway Junction <img src='images/routes/14px/A.gif' align='bottom' /> <img src='images/routes/14px/J.gif' align='bottom' /> | <img src='images/routes/14px/L.gif' align='bottom' /> (to/from Rockaway Pkwy)<br><br>In Manhattan, take the M14A or M14D for <img src='images/routes/14px/L.gif' align='bottom' /> stations along 14 St; transfer between trains and buses at:<br>&bull; 8 Av/14 St <img src='images/routes/14px/A.gif' align='bottom' /> <img src='images/routes/14px/C.gif' align='bottom' /><br>&bull; 6 Av/14 St <img src='images/routes/14px/F.gif' align='bottom' /> <img src='images/routes/14px/M.gif' align='bottom' /> <br>&bull; M14A at Delancey St/Essex St <img src='images/routes/14px/F.gif' align='bottom' /> <img src='images/routes/14px/J.gif' align='bottom' /> <img src='images/routes/14px/M.gif' align='bottom' /><br><br><span id='moretext' style='color:Blue; text-decoration:underline; cursor:pointer;' onclick=ShowCompleteStatus(200295)>Click here for more info</span>";
statustext[201881]="STAIRWAY REPLACEMENT  Through December 2018  Bronx-bound platform at the 215 St <img src='images/routes/14px/1.gif' align='bottom' /> Station is EXIT ONLY<br>$$<br>For uptown service from this station, take a South Ferry-bound <img src='images/routes/14px/1.gif' align='bottom' /> to Dyckman St and transfer to a Van Cortlandt Park-bound <img src='images/routes/14px/1.gif' align='bottom' />.<br><br>Alternate travel option:<br><br>For service to the 225 St-Marble Hill and 231 St <img src='images/routes/14px/1.gif' align='bottom' /> Stations, take a Bronx-bound Bx7 (days/evenings) or Bx20 (rush hours) bus on Broadway at 215 St.<br><br>";
statustext[203774]="TRACK REPLACEMENT  9:45 PM Fri, Nov 9 to 5 AM Mon, Nov 12  Coney Island-bound <img src='images/routes/14px/D.gif' align='bottom' /> trains skip 170 St and 161 St in the Bronx and 155 St in Manhattan<br>$$<br>For service to these stations, take the <img src='images/routes/14px/D.gif' align='bottom' /> to 145 St and transfer to a Norwood-bound <img src='images/routes/14px/D.gif' align='bottom' />.<br><br>For service from these stations, take the <img src='images/routes/14px/D.gif' align='bottom' /> to Tremont Av and transfer to a Coney Island-bound <img src='images/routes/14px/D.gif' align='bottom' />.<br><br>Note:<br>174-175 Sts and 167 St are temporarily closed for renovation.<br><br><img src='images/ADA_WhlChr_small.gif'  /> This service change affects one or more ADA stations.<br><br>";
statustext[203782]="STATION IMPROVEMENTS  10 PM Fri, Nov 9 to 5 AM Mon, Nov 12  Ozone Park/Far Rockaway-bound <img src='images/routes/14px/A.gif' align='bottom' /> trains skip 163, 155, 135, 116, 110, 96, 86, 81 and 72 Sts in Manhattan<br>$$<br>For service to these stations, take the <img src='images/routes/14px/A.gif' align='bottom' /> to 145 St, 125 St or 59 St-Columbus Circle and transfer to an Inwood-bound <img src='images/routes/14px/A.gif' align='bottom' /> local.<br><br>For service from these stations, take the <img src='images/routes/14px/A.gif' align='bottom' /> to 125 St, 145 St or 168 St and transfer to an Ozone Park/Far Rockaway-bound <img src='images/routes/14px/A.gif' align='bottom' />.<br><br>Alternate Travel Note:<br>Use nearby <img src='images/routes/14px/1.gif' align='bottom' /> stations instead; transfer between trains at 168 St or 59 St-Columbus Circle.<br><br>";
